description:
Deadliest Warrior is a television program in which historical warriors are pitted against each other to see who can outlast the other. Each episode showcases two warriors in a hypothetical battle to the death. Each warrior brings weapons from the particular group they are associated with. Modern fighters and experts on said weapons present the strengths, and weaknesses of each arsenal, including real tests of the weapons. The data collected is then fed into a computer simulation based on an unreleased commercial game engine developed by Slitherine Strategies to determine the average winner of one thousand battles. After the winner is determined, a mock battle takes place to showcase how each weapon is used in a real battle situation, and to determine which combatant is the &quot;deadliest warrior&quot;. Geoff Desmoulin is the biomedical scientist and high speed camera operator. Dr. Armand Dorian is the medical consultant. Max Geiger is the simulations programmer. All three provide commentary throughout the show, as well as technical details of each weapons test. The show is narrated by Drew Skye according to the show's credits, . Season 2 will air in Spring 2010 with 13 episodes.

